import { Paper, TextField, Typography } from "@mui/material";
import React from "react"

const Form = () => {
    return (
        <Paper>
                <form autoComplete="off" noValidate onSubmit={handleOnSubmit}>
                    <Typography variant="h6">Upload Post</Typography>
                    <TextField></TextField>
                    <TextField></TextField>
                    <TextField></TextField>
                    <TextField></TextField>
                    <div></div>
                    <Button></Button>
                </form>
        </Paper>
    )
}

export default Form;
